import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import data from './data'
import * as serviceWorker from './serviceWorker';

const Movies= (props)=>
{
    // let {data} = props;
   let movie = props.map(
                        a=><div><h3>{a.Title}</h3>
                                 <p>{a.Type}</p>
                                 <p>{a.Year}</p>
                                 <img src={a.Poster}></img>
                            </div>
                        );
   return movie


}
ReactDOM.render(<Movies data={data}/>, document.getElementById('root'));

